import React from 'react';
import logo from './logo.svg';
import './App.css';

const classes = require('./my-app/classes/primary.json');

class App extends React.Component {
  constructor(props)
   {
    super(props);
    this.state = {name: "Jahi", count: 0};
    this.main = this.main.bind(this);
  }

  main()
  {
    this.setState((state) => {
      return {count: state.count + 1}
    });
  }

  render()
  {
    return(
      <div id="test-a">
        <ul>
          {this.state.count}
        </ul>
        <button onClick={this.main}>Click</button>
      </div>
    );
  }
}


export default App;
